const time=new Date().toLocaleTimeString();
const head={
  color:'red',
  key:'value',
  textTransform:''
}

ReactDOM.render(
  <>
  <h1 style={{head}}>Hello,My name is {name}</h1>
<p>Current date is={date}</p>
<p>Current time is={time}</p>

</>
